import React, { Component, Fragment } from 'react';
import './Search.css';
import SearchResultItem from './SearchResultItem';
import SearchResultNone from './SearchResultNone';
import SearchResultNum from './SearchResultNum';
import Data from './SearchData.json';

import API from '../../api/api';
import axios from 'axios';

class Search extends Component{

	async getData(){
		const resource = await axios.get(
			'https://jsonplaceholder.typicode.com/users'
		);
		console.log(resource);
		console.log(resource.data);
		return (resource.data);
	}

	render() {
		let searchResult;
		if (Data.count === 0)
			searchResult = <SearchResultNone />
		else
			searchResult = <SearchResultItem Data = {Data.data}/>

		return(
			<Fragment>
				<div class="search-container">
					<input type="text" placeholder="도서명, 저자를 입력하세요."/>
					<input type="submit" id="btn" class="test" value="검색" onClick={() => this.getData()}/>
				</div>
				<SearchResultNum count = {Data.count}/>
				{searchResult}
			</Fragment>
		);
	}
}

export default Search;
